webpackJsonp([0x5b22d28db215],{5805:function(e,t){e.exports={data:{post:{html:'<p>An <a href="http://www.instapundit.com/archives/005336.php#005336">email to Glenn Reynolds</a> asks "I wonder if German Chancellor Gerhard Schröder has placed a congratulatory call to President Bush yet?". Actually, according to Spiegel Online, he <a href="http://www.spiegel.de/politik/ausland/0,1518,221621,00.html" title="Spiegel Online: Schröder will Bush gratulieren - trotz allem">has</a>. Or at least he intends to. I guess the real question is, will President Bush bother to pick up the phone when he sees who is calling? </p>\n<p><b>Update</b> Here\'s a quick English summary of the Spiegel article: <b>Schröder wants to congratulate Bush, in spite of everything.</b> Schröder\'s press secretary announced that Schröder wanted to congratulate Bush as soon as the final results are in. He didn\'t want to speculate whether Bush would belatedly congratulate Schröder on his victory in September. "Of course the Chancellor will congratulate the President in the appropriate way." The Foreign Office explained that the Republican victory would have no effect on relations with the US.</p>',fields:{title:"",date:"06 Nov 2002",url:"https://papascott.de/2002-11-06-schroeder-congratulates-bush/"}}},pathContext:{slug:"/2002-11-06-schroeder-congratulates-bush/",prev:{fields:{title:"Deep Dark Links",date:"06 Nov 2002",slug:"/2002-11-06-deep-dark-links/"}},next:{fields:{title:"English Week",date:"07 Nov 2002",slug:"/2002-11-07-english-week/"}}}}}});
